import React from "react";
import "./style.css";
import "bootstrap/dist/css/bootstrap.css";
import Logs from "./Logs.js";
export default class ContinentLogs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      continentId: "",
    };
  }

  componentDidMount() {
    const cid = this.props.match.params.continentId;
    console.log(cid);
    fetch("http://localhost:4000/api/logs")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        // console.log(json);
        // console.log(json.map((each) => each.continentId === cid));
        for (let i = 0; i < json.length; i++) {
          if (json[i].continentId === cid) {
            this.setState({
              data: [...[json[i]]],
            });
          } else {
            console.log("no");
          }
        }
        this.setState({
          continentId: cid,
        });
        // this.setState({
        //   data: [
        //     ...json.map((each) => (each.continentId === cid ? each : null)),
        //   ],
        // });
        // console.log(this.state.data);
      });
  }
  render() {
    return (
      <div className="container-fluid">
        <Logs continentId={this.state.continentId} />
      </div>
    );
  }
}
